import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { getProduk, addProduk, updateProduk, deleteProduk } from '../api';

const Container = styled.div`
  padding: 20px;
`;

const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
`;

const Th = styled.th`
  border: 1px solid #ddd;
  padding: 8px;
  background-color: #f2f2f2;
  text-align: left;
`;

const Td = styled.td`
  border: 1px solid #ddd;
  padding: 8px;
`;

const Button = styled.button`
  background-color: #4caf50;
  color: white;
  padding: 10px;
  margin: 5px;
  border: none;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #45a049;
  }
`;

const DeleteButton = styled(Button)`
  background-color: #f44336;

  &:hover {
    background-color: #d32f2f;
  }
`;

const FormContainer = styled.div`
  margin: 20px 0;
`;

const Input = styled.input`
  margin: 5px;
  padding: 10px;
  border: 1px solid #ddd;
  border-radius: 5px;
  width: calc(100% - 20px);
`;

const DataProduk = () => {
  const [produkList, setProdukList] = useState([]);
  const [form, setForm] = useState({
    nama: '',
    harga: '',
    stok: '',
  });
  const [editId, setEditId] = useState(null);

  useEffect(() => {
    fetchProduk();
  }, []);

  const fetchProduk = async () => {
    const data = await getProduk();
    setProdukList(data);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setForm({ ...form, [name]: value });
  };

  const handleAddProduk = async () => {
    if (form.nama && form.harga && form.stok) {
      await addProduk(form);
      fetchProduk();
      setForm({ nama: '', harga: '', stok: '' });
    } else {
      alert('Mohon isi semua data produk.');
    }
  };

  const handleEditProduk = (produk) => {
    setEditId(produk.id);
    setForm({
      nama: produk.nama,
      harga: produk.harga,
      stok: produk.stok,
    });
  };

  const handleUpdateProduk = async () => {
    if (editId && form.nama && form.harga && form.stok) {
      await updateProduk(editId, form);
      fetchProduk();
      setEditId(null);
      setForm({ nama: '', harga: '', stok: '' });
    } else {
      alert('Mohon isi semua data produk.');
    }
  };

  const handleDeleteProduk = async (id) => {
    if (window.confirm('Apakah Anda yakin ingin menghapus produk ini?')) {
      await deleteProduk(id);
      fetchProduk();
    }
  };

  return (
    <Container>
      <h2>Data Produk</h2>
      <FormContainer>
        <Input
          type="text"
          name="nama"
          placeholder="Nama Produk"
          value={form.nama}
          onChange={handleInputChange}
        />
        <Input
          type="number"
          name="harga"
          placeholder="Harga Produk"
          value={form.harga}
          onChange={handleInputChange}
        />
        <Input
          type="number"
          name="stok"
          placeholder="Stok Produk"
          value={form.stok}
          onChange={handleInputChange}
        />
        {editId ? (
          <Button onClick={handleUpdateProduk}>Update Produk</Button>
        ) : (
          <Button onClick={handleAddProduk}>Tambah Produk</Button>
        )}
      </FormContainer>
      <Table>
        <thead>
          <tr>
            <Th>ID</Th>
            <Th>Nama Produk</Th>
            <Th>Harga</Th>
            <Th>Stok</Th>
            <Th>Aksi</Th>
          </tr>
        </thead>
        <tbody>
          {produkList.map((produk) => (
            <tr key={produk.id}>
              <Td>{produk.id}</Td>
              <Td>{produk.nama}</Td>
              <Td>{produk.harga}</Td>
              <Td>{produk.stok}</Td>
              <Td>
                <Button onClick={() => handleEditProduk(produk)}>Edit</Button>
                <DeleteButton onClick={() => handleDeleteProduk(produk.id)}>
                  Hapus
                </DeleteButton>
              </Td>
            </tr>
          ))}
        </tbody>
      </Table>
    </Container>
  );
};

export default DataProduk;
